function ContumazDestaques () {
    return(
        <div id='destaques'>
            <div>Destaques</div>
            <div>
                <ContumazDestaque/>
            </div>
            <div>
                <ContumazDestaque/>                
            </div>
            <div>
                <ContumazDestaque/>                
            </div>
      </div>
    );
}

export default ContumazDestaques;
